	(42, 4, 'A1619232969', '<img src="data:image/png;base64," alt="none">', 'Cấu trúc cho 1 dự án Vuejs', 'https://viblo.asia/p/structure-a-vuejs-project-jvElawWDKkw', 'Vue.js chỉ là một hype, đó là một khuôn khổ tuyệt vời lối vào. Nó là khá dễ dàng để bắt đầu với nó và để xây dựng một ứng dụng web Vue.js thường được mô tả như là một khuôn khổ cho các ứng dụng nhỏ và thậm chí đôi khi là một thay thế cho jQuery vì kích thước nhỏ của nó! Cá nhân tôi nghĩ rằng nó cũng có thể phù hợp cho các dự án lớn hơn và trong trường hợp này, điều quan trọng là cấu trúc nó tốt, trong điều khoản của kiến trúc thành phần.', '2021-04-25 12:00:45', '2021-04-25 12:00:45', NULL),
	(43, 4, 'A1619173114,A1619232969', NULL, 'Globally Load SASS into your Vue.js Applications - Kỹ thuật load SASS cho Vuejs', 'https://vueschool.io/articles/vuejs-tutorials/globally-load-sass-into-your-vue-js-applications/', 'n the CSS world, we can see plenty of great preprocessors that improve the language, being SASS/SCSS, LESS and PostCSS the most common among them. SASS seems to be still the most popular and used solution by the date of writing, and that\'s no surprise since it\'s fully featured and extends the CSS language with an easy to understand syntax.', '2021-04-25 12:02:14', '2021-04-25 12:02:14', NULL),
