	(49, 4, 'A1619232969', NULL, 'Sử dụng Vue Component trong ứng dụng PHP', 'https://codeburst.io/using-vue-js-components-in-php-applications-e5bfde8763bc', 'A practical guide to bundling Vue.js components with webpack for use in PHP applications.', '2021-04-25 12:07:03', '2021-04-25 12:07:03', NULL),
	(50, 12, 'A1619220703', '<img src="data:image/png;base64," alt="none">', 'Traits in PHP and Laravel', 'https://viblo.asia/p/traits-in-php-and-laravel-l0rvmxzQGyqA', 'Trong nội dung bài viết này chúng ta sẽ cùng tìm hiểu thế nào là Trait? Nó làm việc như thế nào? Nó khác Abstract Class và Interface ra sao? Tại sao chúng ta nên dùng, đồng thời đưa ra những case study cụ thể sử dụng.', '2021-04-26 09:02:26', '2021-04-26 09:02:26', NULL),
	(51, 6, 'A1619083145,A1619220703', NULL, 'Architecture Patterns: MVC, MVP và MVVM', 'https://viblo.asia/p/architecture-patterns-mvc-mvp-va-mvvm-bJzKmLAw59N', 'Bài viết này giới thiệu sơ qua về một số architecture patterns quen thuộc: MVC (Model - View - Controller), MVP (Model - View - Presenter) và MVVM (Model - View - ViewModel).', '2021-04-26 09:02:59', '2021-04-26 09:02:59', NULL),
	(52, 12, 'A1619220703', '<img src="data:image/png;base64," alt="none">', 'Pthreads - Đa luồng trong PHP. Tại sao không?', 'https://viblo.asia/p/pthreads-da-luong-trong-php-tai-sao-khong-djeZ1gEG5Wz', 'Các PHP Developers hiếm khi sử dụng đa luồng. Sự đơn giản của chương trình đồng bộ, đơn luồng chắc chắn rất hấp dẫn, nhưng đôi khi việc sử dụng đa luồng có thể mang lại một số cải tiến hiệu suất đáng kể.', '2021-04-26 09:03:37', '2021-04-26 09:03:37', NULL),
	(53, 6, 'A1619083145,A1619173114', 'STACKOVERFLOW', 'Abstract Class Extending Concrete Classes', 'https://stackoverflow.com/questions/33682403/abstract-class-extending-concrete-classes', 'I have an abstract class that extends a concrete class. But I\'m confused about how to use it. How am I suppose to instantiate the concrete class with the methods in the abstract class like I would normally do the other way around? Or is there another way to instantiate the classes?', '2021-04-26 09:04:42', '2021-04-26 09:04:42', NULL),
