	(63, 1, 'A1619173114,A1619020684', NULL, 'Symfony vs Laravel : Which PHP framework to choose?', 'https://www.valuecoders.com/blog/technology-and-apps/symfony-vs-laravel-php-framework-choose/', 'One of the toughest challenges among startups & SMEs today is building quality websites and applications in the least possible time. This is why business owners across the globe prefer to go for PHP frameworks comparison before starting a new web development project. \r\nBut, there are many web development frameworks available in which Symfony and Laravel stand out with few of its amazing features. This brings in the topic Symfony vs Laravel: Best PHP framework comparison in the custom software development domain.', '2021-04-26 09:17:17', '2021-04-26 09:17:17', NULL),
	(64, 11, 'A1619220695', '<img src="data:image/png;base64," alt="none">', 'Session, Cookie và Cache, bạn đã thực sự hiểu chúng??', 'https://viblo.asia/p/session-cookie-va-cache-ban-da-thuc-su-hieu-chung-3P0lPv3PKox', 'Session, Cookie, Cache có lẽ đây chính là 3 khái niệm được nhắc đến thường xuyên đối với các lập trình viên. Khi mới bắt đầu tập tành làm web, tôi rất hay nhầm lẫn giữa các khái niệm này, tôi không biết lúc nào thì mình nên dùng session, lúc nào mình nên dùng cookie, cache được dùng để làm gì.... Có lần chỉ một chức năng nhỏ để lưu lịch sử thao tác của người dùng trên trình duyệt , tôi đã cho nó vào hết Session và ném cả đám đó cho mentor của mình review, và dĩ nhiên, tôi bị mắng rất thậm tệ.... "Em có biết session là gì không?" "Em có biết cookie là gì không?", "Có biết cái gì cũng nhét hết vào session thế này sẽ làm ngốn rất nhiều bộ nhớ của server không?"..... Vâng tôi đã chẳng biết gì về những khái niệm đó cả, tôi dùng nó một cách vô tội vạ và chỉ quan tâm sao cho chức năng mình làm có thể chạy được mà chẳng quan tâm những cái tôi dùng có đúng mục đích hay không? có thực sự tận dụng nó một cách triệt để, và có thật sự tối ưu hay không? Thật ra thì ... tuổi trẻ mà, CỨ SAI ĐI VÌ CUỘC ĐỜI CHO PHÉP. Càng sai càng nhớ lâu, càng đau, càng nhớ đời. Nào chúng ta cùng tìm hiểu các khái niệm này nhé', '2021-04-26 09:22:30', '2021-04-26 09:22:30', NULL),
