	(66, 12, 'A1619220703', '<img src="data:image/png;base64," alt="none">', 'Lambda và Closures trong PHP', 'https://viblo.asia/p/lambda-va-closures-trong-php-DXOGRZZnGdZ', 'Vừa qua mình gặp 1 tình huống là phải dùng hàm call back để xử lý vấn đề, thế là tìm hiểu luôn cái lý thuyết về php closure xem nó là như thế nào. trước hết là tìm hiểu Lambda.', '2021-04-26 09:23:37', '2021-04-26 09:23:37', NULL),
