	(69, 4, 'A1619173114,A1619220703,A1619232969', NULL, 'Using Vue.js in PHP Tutorial', 'https://www.techiediaries.com/php-vuejs/', 'In this tutorial, you\'ll learn how to use Vue.js in/with PHP in your web project(s). Vue.js is a popular progressive library for building modern user interfaces using features like components and virtual DOM.', '2021-04-26 09:25:10', '2021-04-26 09:25:10', NULL),
	(70, 12, 'A1619173114,A1619220703,A1619232969', NULL, 'Developing With VueJS and PHP', 'https://vegibit.com/developing-with-vuejs-and-php/', 'In this tutorial, we will make use of VueJS and PHP to build a really cool keyword density tool. On the Vue side, we’ll make use of components, templates, and root elements, and more. We will use PHP to generate the form we need, as well as to handle form processing, in addition to making use of the substr_count() function to provide the data we need. You might also like how to use vuejs in laravel as well. Let’s see how we can do this, it should be fun.', '2021-04-26 09:26:17', '2021-04-26 09:26:17', NULL),
	(71, 12, 'A1619173114,A1619220703,A1619232969', NULL, 'Using VueJs in an existing php site', 'https://forum.vuejs.org/t/using-vuejs-in-an-existing-php-site/40551/6', 'In order to receive the best answers to your questions please follow these simple guidelines.\r\nBe descriptive about your question or problem and be sure to include any errors. Single line topics will rarely receive answers and do not just post a screenshot.\r\nProvide examples of the code in question and use syntax highlighting.\r\nBreakdown the issue in your code and provide a link to an example that replicates it. Use JSFiddle, CodePen, JSBin, or CodeSandbox.\r\nFollowing these few steps will greatly improve your chances of getting a good quality answer to your issue. Remember, everyone is here to share ideas and to help out using their own free time. Making an effort to craft a well thought out topic pays tribute to this.', '2021-04-26 09:27:15', '2021-04-26 09:27:15', NULL),
