	(79, 12, 'A1619428153,A1619220703', NULL, 'Coding standards in PHP using PHP-CS-Fixer', 'https://dev.to/purplebooth/coding-standards-in-php-using-php-cs-fixer', 'One of the best things you can do early on in your project is define a coding standard.\r\nThis has a number of benefits:\r\nStandard inline documentation\r\nNo indentation conflicts when editing others code\r\nReduced cognitive overhead when switching files and code blocks\r\nLess time talking about coding standards\r\nEnable static analysis of code based on inline documentation', '2021-04-26 09:34:52', '2021-04-26 09:34:52', NULL),
